import React from 'react';
import { AppBar, CssBaseline, Toolbar, Typography } from '@mui/material'
import { PhotoCamera } from '@mui/icons-material';

const App = () => {

    return (
            <>
                <CssBaseline />
                <AppBar position = "relative">
                    <Toolbar>
                        <PhotoCamera />
                        <Typography varient = "h6">
                            Photo Album
                        </Typography>
                    </Toolbar>

                    <main>
                        <div>
                            <container maxWidth = "sm">
                                

                            </container>
                        </div>
                    </main>

                </AppBar>
            
            </>

        );
}

export default App;
